<script type="text/javascript">
    var Tresc = function() {
        var self = this;
        self.Kod = ko.observable();
        self.Tytuly = ko.observableArray();
        self.Komunikaty = ko.observableArray();
        self.Opis = ko.computed(function() {
            var result = [];
            $.each(self.Tytuly(), function(i, e) {
                if ($.inArray(e, result) == -1) {
                    result.push(e);
                }
            });
            return result.join(" / ");;
        }, self);
    };

    var TresciViewModel = function() {
        var self = this;
        self.KategorieTresci = ko.observableArray();
        var url = "/Home/WazneInformacje?vm=%7B%22IdentyfikatorStrony%22%3A%22W%22%2C%22IdentyfikatoryAplikacji%22%3A%5B2%2C3%5D%7D";
        $.getJSON(url, function(model) {
            for (key in model) {
                var tresc = new Tresc();
                tresc.Kod(key);
                var value = model[key];
                var content = value;
                tresc.Tytuly.push(content.Tytul);
                tresc.Komunikaty.push(content.Komunikat);
                self.KategorieTresci.push(tresc);
            };
            if (self.KategorieTresci().length > 0) {
                $(".tresci").kendoPanelBar({
                    expandMode: "multiple"
                });
                $('#yellowCards').fadeIn("slow");
            }
        });
        self.Close = function() {
            $('#yellowCards').fadeOut();
        };       
    };
    
    var tresciViewModel = new TresciViewModel();
    ko.applyBindings(tresciViewModel, document.getElementById("wazne-informacje"));
</script>





