    <h5>Ostatnio wyszukiwane połączenia</h5>
    <article>
        <input style="width: 500px;" data-bind="kendoDropDownList: { optionLabel: 'Wybierz zapamiętane kryteria wyszukiwania...',
                                                                     dataTextField: 'opis', 
                                                                     dataValueField: 'id', 
                                                                     data: zestawy, 
                                                                     value: wybranyZestaw }" />
        <button type="button" class="k-button k-button-get" data-bind="click: wybierzKryteriaClick">Wybierz</button>
        <span class="remove" data-bind="click: wyczyscHistorieClick">Usuń zapamiętane</span>
    </article>
</div>

<script type="text/javascript">

    var licznik = 0;

    function ZestawKryteriowWyszukiwania(dataWyszukiwania, kryteriaWyszukiwania) {
        var self = this;

        self.id = ko.observable((licznik++).toString());
        self.dataWyszukiwania = ko.observable(dataWyszukiwania);
        self.kryteriaWyszukiwania = ko.observable(kryteriaWyszukiwania);

        self.opis = ko.computed(function () {
            var kryteria = self.kryteriaWyszukiwania();
            if (kryteria != undefined) {
                var opis = "godz.: " + kendo.toString(self.dataWyszukiwania(), 'HH:mm:ss, dd.MM.yyyy')
                    + " " + kryteria.NazwaStacjiPoczatkowej + " / " + kryteria.NazwaStacjiKoncowej + "";
                return opis;
            } else {
                return null;
            }
        }, self);

        self.pobierzJson = function () {
            return {
                Id: self.id(),
                DataWyszukiwania: Date.parse(self.dataWyszukiwania()).toString(),
                KryteriaWyszukiwania: self.kryteriaWyszukiwania()
            };
        };
    }

    function HistoriaWyszukiwaniaViewModel() {
        var self = this;

        self.zestawy = ko.observableArray();
        self.wybranyZestaw = ko.observable();

        var klucze = $.jStorage.index();
        for (var z = 0; z < klucze.length; z++) {
            var obiekt = JSON.parse($.jStorage.get(klucze[z]));
            if (obiekt) {
                self.zestawy.push(new ZestawKryteriowWyszukiwania(
                    new Date(parseInt(obiekt.DataWyszukiwania)),
                    obiekt.KryteriaWyszukiwania));
            }
        }

        self.visible = ko.observable(self.zestawy().length > 0);

        self.wybierzKryteriaClick = function () { };

        self.wyczyscHistorieClick = function () {
            self.zestawy.splice(0, self.zestawy().length);
            odswiezCache();
            self.visible(false);
        };

        self.dodajZestaw = function (kryteriaWyszukiwania) {
            if (self.zestawy().length == 5) {
                self.zestawy.remove(self.zestawy()[0]);
            }
            var zestaw = new ZestawKryteriowWyszukiwania(new Date(), kryteriaWyszukiwania);
            self.zestawy.push(zestaw);
            odswiezCache();
            self.wybranyZestaw(zestaw.id());
            self.visible(true);
        };

        self.pobierzWybranyZestaw = function () {
            var pasujace = ko.utils.arrayFilter(self.zestawy(), function (item) {
                return item.id().toString() == self.wybranyZestaw().toString();
            });
            if (pasujace.length == 1) {
                return pasujace[0];
            }
            return null;
        };

        function odswiezCache() {
            $.jStorage.flush();
            ko.utils.arrayForEach(self.zestawy(), function (item) {
                $.jStorage.set(item.id(), JSON.stringify(item.pobierzJson()));
            });
        }
    }
</script>

