        <form id="kryteria-wyszukiwania">
            <div class="editor">
    
<article class="sBox route">
    <div class="header">
        <h5>Trasa</h5>
        <div class="help">
            <span class="gui icoHelp"></span>
            <div class="helpBody">
                <p>Należy wypełnić formularz uzupełniając pola<br /><em>"Wyjazd z"</em> oraz <em>"Do"</em>. System podpowiada nazwę po wpisaniu pierwszych 3-ch znaków.</p>
                <p>Aby szybko zamienić miejscami wypełnione pola "wyjazd z" i "do" należy kliknąć przycisk - <span class="gui icoSwitchArrs-B"></span></p>
                <p><em>Połączenia bezpośrednie</em> – wyszukiwanie połączeń z wyłączeniem przejazdów, które wymagają przesiadki.</p>
            </div>
        </div>
    </div>
    <div class="container">
        <div class="row">
            <input class="required station station-repeat" style="width: 296px" autocomplete="off"
                   data-bind="uniqueName: true, widget: stacjaPoczatkowaWidget, kendoComboBox: { placeholder: 'Wyjazd z', 
                                                                                                 value: idStacjiPoczatkowej,
                                                                                                 dataTextField: 'Nazwa',
                                                                                                 dataValueField: 'ID',
                                                                                                 minLength: 3,
                                                                                                 autoBind: false,
                                                                                                 filter: 'startswith',  
                                                                                                 delay: '200',  
                                                                                                 dataBound: stacjaDataBound,          
                                                                                                 dataSource: {
                                                                                                     serverFiltering: true,
                                                                                                     transport: {
                                                                                                        read: '/WyszukiwaniePolaczen/StacjeFiltrRead',
                                                                                                        parameterMap: pobierzNazweStacjiPoczatkowej
                                                                                                     }
                                                                                                 }}" />
            <button type="button" class="k-button k-button-flip" tabindex="-1" data-bind="click: zamienStacjeNaListachClick"></button>
            <input class="required station station-repeat" style="width: 296px;" autocomplete="off"
                   data-bind="uniqueName: true, widget: stacjaKoncowaWidget, kendoComboBox: { placeholder: 'Do',
                                                                                              value: idStacjiKoncowej,
                                                                                              dataTextField: 'Nazwa',
                                                                                              dataValueField: 'ID',
                                                                                              minLength: 3,
                                                                                              autoBind: false,
                                                                                              filter: 'startswith',  
                                                                                              delay: '200',  
                                                                                              dataBound: stacjaDataBound,
                                                                                              dataSource: {
                                                                                                  serverFiltering: true,
                                                                                                  transport: {
                                                                                                      read: '/WyszukiwaniePolaczen/StacjeFiltrRead',
                                                                                                      parameterMap: pobierzNazweStacjiKoncowej
                                                                                                  }
                                                                                              }}"/>
            <label class="inlineRCH k-button-directConnection">
                <input name="preferenceDirectly" type="checkbox" data-bind="checked: polaczenieBezposrednie" />
                Połączenie bezpośrednie
            </label>
        </div>
    </div>
</article>
    
<article class="sBox route throughStations searcher">
    <div class="header">
        <div class="collapse-button collapse-wp-throughStations k-panelbar">
            <h5>
                Stacja pośrednia
                <span role="presentation" class="wp-throughStations-arrow k-icon k-i-arrow-n">Zamknij</span>
            </h5>
        </div>
        <div class="help">
            <span class="gui icoHelp"></span>
            <div class="helpBody" style="width: 320px;">
                <p>Opcjonalnie możliwe jest dodanie maksymalnie 10-ciu stacji pośrednich pomiędzy punktem startowym, a celem podróży, wraz z ustaleniem czasu pobytu w danej miejscowości.</p>
            </div>
        </div>
    </div>
    <div class="container wp-throughStations">
        <div class="row">
            <button type="button" class="k-button k-button-through" data-bind="visible: stacjePosrednie().length == 0, click: dodajPierwszaStacjePosredniaClick">
                Dodaj stację pośrednią
            </button>
            <button type="button" enable="false" class="k-state-disabled k-button k-button-through" data-bind="visible: stacjePosrednie().length > 0">
                Przez stacje pośrednie
            </button>
        </div>
        
<div class="row" data-bind="visible: stacjePosrednieVisible">
    <div data-bind="foreach: stacjePosrednie">
        <div class="row subRow">
            <input class="required station station-repeat" style="width: 296px" autocomplete="off"
                   data-bind="uniqueName: true, widget: stacjaWidget, kendoComboBox: { placeholder: 'Stacja pośrednia',
                                                                                       value: idStacji,
                                                                                       dataTextField: 'Nazwa',
                                                                                       dataValueField: 'ID',
                                                                                       minLength: 3,
                                                                                       autoBind: false,
                                                                                       filter: 'startswith',  
                                                                                       delay: '200',  
                                                                                       dataBound: $root.stacjaDataBound,
                                                                                       dataSource: {
                                                                                           serverFiltering: true,
                                                                                           transport: {
                                                                                               read: '/WyszukiwaniePolaczen/StacjeFiltrRead',
                                                                                               parameterMap: pobierzNazweStacji
                                                                                           }
                                                                                       }}" />
            <input style="width: 140px" class="required time" placeholder="Czas pobytu"
                   data-bind="uniqueName: true, kendoTimePicker: { value:  czasPobytu, format: 'HH:mm' }" />
            <div class="help" style="margin-top: 8px">
                <span class="gui icoHelp"></span>
                <div class="helpBody">
                    <p>Brak wyboru konkretnego czasu pobytu w danej miejscowości, skutkuje wyszukaniem kolejnego połączenia, nie wcześniej niż po 15 min od zakończenia poprzedniego etapu podróży.</p>
                </div>
            </div>
            <div class="actions">
                <span class="remove removeSubRow" data-bind="click: $root.usunStacjePosredniaClick">Usuń</span>
                <p class="move">
                    <span class="moveUp" data-bind="click: $root.przesunStacjePosredniaDoGoryClick, visible: przesunDoGoryEnable">Do góry</span>
                    <span class="moveDown" data-bind="click: $root.przesunStacjePosredniaNaDolClick, visible: przesunNaDolEnable">Na dół</span>
                </p>
            </div>
        </div>
    </div>
    <div class="row btnRow">
        <button type="button" class="k-button k-button-get" data-bind="click: dodajStacjePosredniaClick, visible: stacjePosrednie().length < 10">
            Dodaj kolejną stację pośrednią
        </button>
    </div>
</div>


    </div>
</article>
    
<article class="sBox date">
    <div class="header">
        <h5>Termin</h5>
        <div class="help">
            <span class="gui icoHelp"></span>
            <div class="helpBody">
                <p>Należy ustalić datę i godzinę planowanej podróży.</p>
                <p>
                    Wyszukiwanie połączeń może nastąpić wg czasu oznaczającego:
                    <ol>
                        <li>wyjazd – godzina rozpoczęcia podróży</li>
                        <li>przyjazd – godzina dotarcia do stacji docelowej</li>
                    </ol>
                </p>
            </div>
        </div>
    </div>
    <div class="container">
        <div class="row">
            <span class="timetableTermInfo" style="display: none;"></span>
            <input style="width: 296px" class="required dateISO date-range placeholder-area" placeholder="Data"
                   data-bind="uniqueName: true, kendoDatePicker: { value: data, min: dataMin, max: dataMax, change: function() { terminWZamknieciu(this.value()); } }" />
            <input style="width: 296px" class="required time placeholder-area" placeholder="Czas"
                   data-bind="uniqueName: true, kendoTimePicker: { value:  czas }" />
            <label class="inlineRCH k-button-conectionDirection">
                <input type="radio" name="przyjazd-odjazd" value="Przyjazd" data-bind="checked: przyjazdOdjazd" />
                Przyjazd
            </label>
            <label class="inlineRCH k-button-conectionDirection">
                <input type="radio" name="przyjazd-odjazd" value="Odjazd" data-bind="checked: przyjazdOdjazd" />
                Odjazd
            </label>
        </div>
    </div>
</article>

    
<article class="sBox parameters searcher">
    <div class="header">
        <div class="collapse-button collapse-wp-parameters k-panelbar">
            <h5>
                Parametry połączenia
                <span role="presentation" class="wp-parameters-arrow k-icon k-i-arrow-n">Zamknij</span>
            </h5>
        </div>
        <div class="help">
            <span class="gui icoHelp"></span>
            <div class="helpBody">
                <p><em>Parametry</em> - środki transportu, preferencje, minimalny czas przesiadki oraz połączenia bezpośrednie umożliwiają wybór wariantów podróży. Można zaznaczyć jeden lub wiele parametrów dla danego wyszukiwania. W przypadku planowania podróży przez stacje pośrednie, możliwe jest wybranie oddzielnych parametrów dla każdego planowanego fragmentu trasy przejazdu.</p>
                <p><em>Środki transportu</em> - szybki, dalekobieżny, lokalny, aglomeracyjny.</p>
                <p><em>Preferencje</em> - lista usług świadczonych w pociągach przez przewoźników.</p>
                <p><em>Minimalny czas przesiadki</em> – oznacza minimalny przedział czasowy pomiędzy poszczególnymi połączeniami.</p>
                <p><em>Przewoźnik</em> – lista przewoźników oferujących swoje połączenia.</p>
            </div>
        </div>
    </div>
    <div class="container wp-parameters">
        <div data-bind="visible: globalneParametryPolaczeniaVisible">
            <div class="row paramsSimple act">
    <div class="multiMenu parametersMenu">
        <span class="item">Środki transportu: <span class="num">wybrano <span data-bind="text: kategorieSzybkosci().length"></span></span></span>
        <div class="layer">
            <ul data-bind="foreach: dostepneKategorieSzybkosci">
                <li>
