<script type="text/javascript">
    
    $(".k-button-flip").kendoTooltip({
        content: 'Zamiana wpisów "wyjazd z" i "do"'
    });

    ko.bindingHandlers.widget = {
        init: function(element, valueAccessor) {            
            var value = valueAccessor();
            value(element);
        }
    };
    
    function StacjaPosrednia(parent) {
        var self = this;

        function pobierzKluczeDostepnychKategoriiSzybkosci() {
            var klucze = [];
            for (var i = 0; i < parent.dostepneKategorieSzybkosci.length; i++) {
                klucze.push(parent.dostepneKategorieSzybkosci[i].Kod);
            }
            return klucze;
        }

        var dostepneKategorieSzybkosciKlucze = pobierzKluczeDostepnychKategoriiSzybkosci();

        self.idStacji = ko.observable(); 
        self.nazwaStacji = ko.observable();
        self.stacjaWidget = ko.observable();
        self.czasPobytu = ko.observable("00:00"); 
        self.kategorieSzybkosci = ko.observableArray(dostepneKategorieSzybkosciKlucze);
        self.uslugi = ko.observableArray();
        self.polaczenieBezposrednie = ko.observable(false); 
        
        self.czasPobytuFormatowany = ko.computed(function() {
            return kendo.toString(self.czasPobytu(), 'HH:mm');
        }, self);
        
        self.idStacji.subscribe(function() {             
            var comboBox = $(self.stacjaWidget()).data("kendoComboBox");            
            self.nazwaStacji(comboBox.text());
        }); 
        
        self.pobierzNazweStacji = function(options, operation) {
            var comboBox = $(self.stacjaWidget()).data("kendoComboBox");            
            return {
                wprowadzonyTekst: comboBox.text()
            };
        };
        
        self.nazwaStacjiOpis = ko.computed(function() {
            return $.trim(self.nazwaStacji()) == '' ? 'Brak nazwy' : $.trim(self.nazwaStacji());
        }, self);      

        self.przesunDoGoryEnable = ko.computed(function() {
            return parent.przesunStacjePosredniaDoGoryEnable(self);
        }, self);
        
        self.przesunNaDolEnable = ko.computed(function() {
            return parent.przesunStacjePosredniaNaDolEnable(self);
        }, self);
       
    }

    var KryteriaWyszukiwaniaViewModel = function() {        
        var self = this;
        
        var dataczas = new Date();
 
        self.dostepneKategorieSzybkosci = model.DostepneKategorieSzybkosci;
        self.dostepneUslugi = model.DostepneUslugi;
        self.dostepniPrzewoznicy = model.DostepniPrzewoznicy;
        self.dostepneCzasyPrzesiadek = [
            { czas: "00:03", opis: "Minimalny czas przesiadki: co najmniej 3 minuty" },
            { czas: "00:05", opis: "Minimalny czas przesiadki: co najmniej 5 minut" },
            { czas: "00:10", opis: "Minimalny czas przesiadki: co najmniej 10 minut" },
            { czas: "00:15", opis: "Minimalny czas przesiadki: co najmniej 15 minut" },
            { czas: "00:20", opis: "Minimalny czas przesiadki: co najmniej 20 minut" },
            { czas: "00:25", opis: "Minimalny czas przesiadki: co najmniej 25 minut" },
            { czas: "00:30", opis: "Minimalny czas przesiadki: co najmniej 30 minut" },
            { czas: "00:35", opis: "Minimalny czas przesiadki: co najmniej 35 minut" },
            { czas: "00:40", opis: "Minimalny czas przesiadki: co najmniej 40 minut" },
            { czas: "00:45", opis: "Minimalny czas przesiadki: co najmniej 45 minut" }                     
        ];
        
        for (var g = 0; g < self.dostepneUslugi.length; g++) {
            self.dostepneUslugi[g].OpisSkrocony = self.dostepneUslugi[g].Opis.length > 50 
                ? $.trim(self.dostepneUslugi[g].Opis.substring(0, 50)) + " ..." 
                : self.dostepneUslugi[g].Opis;
        }
        
        function pobierzKluczeDostepnychKategoriiSzybkosci() {
            var klucze = [];
            for (var i = 0; i < self.dostepneKategorieSzybkosci.length; i++) {
                klucze.push(self.dostepneKategorieSzybkosci[i].Kod);
            }
            return klucze;
        }
        
        function pobierzKluczeDostepnychPrzewoznikow() {
            var klucze = [];
            for (var j = 0; j < self.dostepniPrzewoznicy.length; j++) {
                klucze.push(self.dostepniPrzewoznicy[j].Skrot);
            } 
            return klucze;
        }
        
        var dostepneKategorieSzybkosciKlucze = pobierzKluczeDostepnychKategoriiSzybkosci();
        var dostepniPrzewoznicyKlucze = pobierzKluczeDostepnychPrzewoznikow();
       
        var kategorieHandlowe;
        var przewoznikKategorieHandlowe;
        for (var ks = 0; ks < self.dostepneKategorieSzybkosci.length; ks++) {
            kategorieHandlowe = "";
            for (var prz = 0; prz < self.dostepniPrzewoznicy.length; prz++) {
                przewoznikKategorieHandlowe = "";
                for (var kh = 0; kh < self.dostepneKategorieSzybkosci[ks].KategoriaHandlowa.length; kh++) {
                    if (self.dostepneKategorieSzybkosci[ks].KategoriaHandlowa[kh].PrzewoznikSkrot == self.dostepniPrzewoznicy[prz].Skrot) {
                        przewoznikKategorieHandlowe = przewoznikKategorieHandlowe + self.dostepneKategorieSzybkosci[ks].KategoriaHandlowa[kh].Nazwa + ", ";
                    }
                }
                if (przewoznikKategorieHandlowe.length > 0) {
                    kategorieHandlowe = kategorieHandlowe + "<b>" + self.dostepniPrzewoznicy[prz].Nazwa + ":</b> " 
                        + przewoznikKategorieHandlowe.substr(0, przewoznikKategorieHandlowe.length - 1) + "</br>";
                }                
            }
            self.dostepneKategorieSzybkosci[ks].KategoriaHandlowaTekst = kategorieHandlowe;
            self.dostepneKategorieSzybkosci[ks].KategoriaHandlowaNaglowek = self.dostepneKategorieSzybkosci[ks].Opis;
        }

        var liczbaElementowGrupyUslug = 12;
        var uslugiDoWyboru = [];
        for (var gr = 0; gr < self.dostepneUslugi.length ; gr++) {
            if (self.dostepneUslugi[gr].Wyszukiwarka) {
                uslugiDoWyboru.push(self.dostepneUslugi[gr]);
            }
        }
        self.grupyUslug = [];
        for (var gr = 0; gr < Math.ceil(uslugiDoWyboru.length / liczbaElementowGrupyUslug) ; gr++) {
            self.grupyUslug.push(uslugiDoWyboru.slice(gr * liczbaElementowGrupyUslug, (gr + 1) * liczbaElementowGrupyUslug));
        }
        
        self.dataMin = new Date(parseInt(model.DataMin.substr(6)));
        self.dataMax = new Date(parseInt(model.DataMax.substr(6)));
        
        self.idStacjiPoczatkowej = ko.observable();
        self.nazwaStacjiPoczatkowej = ko.observable();
        self.stacjaPoczatkowaWidget = ko.observable();
        self.stacjePosrednie = ko.observableArray();
        self.idStacjiKoncowej = ko.observable();
        self.nazwaStacjiKoncowej = ko.observable();
        self.stacjaKoncowaWidget = ko.observable();
        self.kategorieSzybkosci = ko.observableArray(dostepneKategorieSzybkosciKlucze);
        self.uslugi = ko.observableArray();
        self.polaczenieBezposrednie = ko.observable(false);
        self.data = ko.observable(kendo.toString(dataczas, 'yyyy-MM-dd'));
        self.czas = ko.observable(kendo.toString(dataczas, 'HH:mm'));
        self.przyjazdOdjazd = ko.observable("Odjazd");
        self.przewoznicy = ko.observableArray(dostepniPrzewoznicyKlucze);
        var minCzasPrzes = model.MinimalnyCzasNaPrzesiadke.Minutes.toString();
        self.minimalnyCzasNaPrzesiadke = ko.observable("00:" + (minCzasPrzes.length == 1 ? "0" + minCzasPrzes : "" + minCzasPrzes).toString());

        self.nazwaStacjiPoczatkowejOpis = ko.computed(function() {
            return $.trim(self.nazwaStacjiPoczatkowej()) == '' ? 'Brak nazwy' : $.trim(self.nazwaStacjiPoczatkowej());
        }, self);
        
        self.nazwaStacjiKoncowejOpis = ko.computed(function() {
            return $.trim(self.nazwaStacjiKoncowej()) == '' ? 'Brak nazwy' : $.trim(self.nazwaStacjiKoncowej());
        }, self);

        self.dataFormatowana = ko.computed(function() {
            return kendo.toString(self.data(), 'yyyy-MM-dd');
        }, self);
        
        self.czasFormatowany = ko.computed(function () {
            return kendo.toString(self.czas(), 'HH:mm');
        }, self);
        
        self.minimalnyCzasNaPrzesiadkeFormatowany = ko.computed(function() {
            for (var i = 0; i < self.dostepneCzasyPrzesiadek.length; i++) {
                if (self.dostepneCzasyPrzesiadek[i].czas == self.minimalnyCzasNaPrzesiadke()) {
                    return self.dostepneCzasyPrzesiadek[i].opis.replace("Minimalny czas przesiadki: ", "");
                }                
            }
            return "";
        }, self);

        self.pobierzNazweStacjiPoczatkowej = function(options, operation) {            
            var comboBox = $(self.stacjaPoczatkowaWidget()).data("kendoComboBox");                        
            return {
                wprowadzonyTekst: comboBox.text()
            };
        };
        
        self.pobierzNazweStacjiKoncowej = function(options, operation) {
            var comboBox = $(self.stacjaKoncowaWidget()).data("kendoComboBox");            
            return {
                wprowadzonyTekst: comboBox.text()
            };
        };
                
        self.globalneParametryPolaczeniaVisible = ko.observable(true);
        self.kategorieSzybkosciVisible = ko.observable(false);
        self.uslugiVisible = ko.observable(false);    
        self.polaczeniaBezposrednieVisible = ko.observable(false);
        self.stacjePosrednieVisible = ko.observable(false);
        self.podsumowanieKryteriowWyszukiwaniaVisible = ko.observable(false);
