        self.przesunStacjePosrednia = function(oldIndex, newIndex) {
            if (newIndex < 0 || newIndex >= self.stacjePosrednie().length || oldIndex == newIndex) {
                return;
            }
            var idStacji = self.stacjePosrednie()[oldIndex].idStacji();
            var nazwaStacji = self.stacjePosrednie()[oldIndex].nazwaStacji();
            self.stacjePosrednie()[oldIndex].idStacji("");      
            self.stacjePosrednie.splice(newIndex, 0, self.stacjePosrednie.splice(oldIndex, 1)[0]);
            var comboBoxStacja = $(self.stacjePosrednie()[newIndex].stacjaWidget()).data("kendoComboBox");
            comboBoxStacja.text(nazwaStacji);      
            self.stacjePosrednie()[newIndex].idStacji(idStacji);
