        self.czyIstniejaPowieloneStacje = function (idStacji) {
            var identyfikatory = $.map(self.stacjePosrednie(), function(stacja) {
                return stacja.idStacji();
            });
            identyfikatory.unshift(self.idStacjiPoczatkowej());
            identyfikatory.push(self.idStacjiKoncowej());
            identyfikatory = identyfikatory.sort();
            var duplikaty = [];
            for (var i = 0; i < identyfikatory.length - 1; i++) {
                if (identyfikatory[i] == identyfikatory[i + 1]) {
                    duplikaty.push(identyfikatory[i]);
                }
            }
            if (idStacji == null) {
                return duplikaty.length > 0;
            }            
            return $.inArray(idStacji, duplikaty) > -1;
        };
        
