        self.ustawWartosci = function (json) {
            $.ajax({
                async: false,
                type: "GET",
                data: { wprowadzonyTekst: json.NazwaStacjiPoczatkowej },
                dataType: "json",
                url: "/WyszukiwaniePolaczen/StacjeFiltrRead",
                success: function (res) {
                    var comboBoxStacjaPoczatkowa = $(self.stacjaPoczatkowaWidget()).data("kendoComboBox");
                    self.idStacjiPoczatkowej(res[0].ID);
                    comboBoxStacjaPoczatkowa.value(null);
                    comboBoxStacjaPoczatkowa.value(res[0].ID);
                    comboBoxStacjaPoczatkowa.text(json.NazwaStacjiPoczatkowej);
                    comboBoxStacjaPoczatkowa.dataSource.data([]);
                }
            });
            $.ajax({
                async: false,
                type: "GET",
                data: { wprowadzonyTekst: json.NazwaStacjiKoncowej },
                dataType: "json",
                url: "/WyszukiwaniePolaczen/StacjeFiltrRead",
                success: function (res) {
                    var comboBoxStacjaKoncowa = $(self.stacjaKoncowaWidget()).data("kendoComboBox");
                    self.idStacjiKoncowej(res[0].ID);
                    comboBoxStacjaKoncowa.value(null);
                    comboBoxStacjaKoncowa.value(res[0].ID);
                    comboBoxStacjaKoncowa.text(json.NazwaStacjiKoncowej);
                    comboBoxStacjaKoncowa.dataSource.data([]);
                }
            });
            self.kategorieSzybkosci(json.KategorieSzybkosci);
            self.uslugi(json.Uslugi);
            self.polaczenieBezposrednie(json.PolaczenieBezposrednie);
            self.globalneParametryPolaczeniaVisible(json.GlobalneParametryPolaczenia);
            self.data(json.Data);
            self.czas(json.Czas);
            self.przyjazdOdjazd(json.PociagCzynnosc);
            self.przewoznicy(json.Przewoznicy);
            self.minimalnyCzasNaPrzesiadke(json.MinimalnyCzasNaPrzesiadke);
            self.stacjePosrednie.splice(0, self.stacjePosrednie().length);
            for (var s = 0; s < json.StacjePosrednie.length; s++) {
                var stacja = new StacjaPosrednia(self);
                self.stacjePosrednie.push(stacja);
                $.ajax({
                    async: false,
                    type: "GET",
                    data: { wprowadzonyTekst: json.StacjePosrednie[s].NazwaStacji },
                    dataType: "json",
                    url: "/WyszukiwaniePolaczen/StacjeFiltrRead",
                    success: function (res) {
                        var comboBoxStacja = $(stacja.stacjaWidget()).data("kendoComboBox");
                        stacja.idStacji(res[0].ID);
                        comboBoxStacja.text(json.StacjePosrednie[s].NazwaStacji);
                        stacja.czasPobytu(json.StacjePosrednie[s].CzasPobytu);
                        stacja.kategorieSzybkosci(json.StacjePosrednie[s].KategorieSzybkosci);
                        stacja.uslugi(json.StacjePosrednie[s].Uslugi);
                        stacja.polaczenieBezposrednie(json.StacjePosrednie[s].PolaczenieBezposrednie);
                    }
                });      
            }
            if (self.stacjePosrednie().length > 0) {
                self.stacjePosrednieVisible(true);
            } else {
                self.stacjePosrednieVisible(false);
            }
        };
        
