        self.ustawWartosciDlaPodrozyPowrotnej = function(data, czas, polaczeniePierwotne) {
            if (!polaczeniePierwotne) {
                var idStacjiPoczatkowej = self.idStacjiPoczatkowej();
                var nazwaStacjiPoczatkowej = self.nazwaStacjiPoczatkowej();
                var idStacjiKoncowej = self.idStacjiKoncowej();
                var nazwaStacjiKoncowej = self.nazwaStacjiKoncowej();
                var comboBoxStacjaPoczatkowa = $(self.stacjaPoczatkowaWidget()).data("kendoComboBox");
                comboBoxStacjaPoczatkowa.value(null);                    
                comboBoxStacjaPoczatkowa.text(nazwaStacjiKoncowej);
                comboBoxStacjaPoczatkowa.value(nazwaStacjiKoncowej);
                comboBoxStacjaPoczatkowa.dataSource.data([]);
                self.idStacjiPoczatkowej(idStacjiKoncowej);                
                var comboBoxStacjaKoncowa = $(self.stacjaKoncowaWidget()).data("kendoComboBox");
                comboBoxStacjaKoncowa.value(null);                    
                comboBoxStacjaKoncowa.text(nazwaStacjiPoczatkowej);                
                comboBoxStacjaKoncowa.value(nazwaStacjiPoczatkowej);                
                comboBoxStacjaKoncowa.dataSource.data([]);
                self.idStacjiKoncowej(idStacjiPoczatkowej);
            }
            self.data(data);
            self.czas(czas);
            var stacje = [];
            for (var s = 0; s < self.stacjePosrednie().length; s++) {
                stacje.unshift({                    
                    IdStacji: self.stacjePosrednie()[s].idStacji(),
                    NazwaStacji: self.stacjePosrednie()[s].nazwaStacji(),
                    CzasPobytu: self.stacjePosrednie()[s].czasPobytu(),
                    KategorieSzybkosci: self.stacjePosrednie()[s].kategorieSzybkosci(),
                    Uslugi: self.stacjePosrednie()[s].uslugi(),
                    PolaczenieBezposrednie: self.stacjePosrednie()[s].polaczenieBezposrednie(),
                });
            }
            self.stacjePosrednie.splice(0, self.stacjePosrednie().length);
            var stacja;
            var comboBoxStacja;
            if (stacje.length > 0) {
                stacja = new StacjaPosrednia(self);
                self.stacjePosrednie.push(stacja);
                comboBoxStacja = $(stacja.stacjaWidget()).data("kendoComboBox");
                comboBoxStacja.text(stacje[0].NazwaStacji);
                stacja.idStacji(stacje[0].IdStacji);
                stacja.czasPobytu(stacje[0].CzasPobytu);
                stacja.kategorieSzybkosci(self.kategorieSzybkosci());
                stacja.uslugi(self.uslugi());
                stacja.polaczenieBezposrednie(self.polaczenieBezposrednie());
                for (s = 1; s < stacje.length; s++) {
                    stacja = new StacjaPosrednia(self);
                    self.stacjePosrednie.push(stacja);
                    comboBoxStacja = $(stacja.stacjaWidget()).data("kendoComboBox");
                    comboBoxStacja.text(stacje[s].NazwaStacji);
                    stacja.idStacji(stacje[s].IdStacji);
                    stacja.czasPobytu(stacje[s].CzasPobytu);
                    stacja.kategorieSzybkosci(stacje[s - 1].KategorieSzybkosci);
                    stacja.uslugi(stacje[s - 1].Uslugi);
                    stacja.polaczenieBezposrednie(stacje[s - 1].PolaczenieBezposrednie);
                }
                self.kategorieSzybkosci(stacje[stacje.length - 1].KategorieSzybkosci);
                self.uslugi(stacje[stacje.length - 1].Uslugi);
                self.polaczenieBezposrednie(stacje[stacje.length - 1].PolaczenieBezposrednie);            
            }            
            if (self.stacjePosrednie().length > 0) {
                self.stacjePosrednieVisible(true);
            } else {
                self.stacjePosrednieVisible(false);
            }
        };

        self.wyszukajStacje = function(wprowadzonyTekst, widget) {
            var result = eval($.ajax({
                url: '/WyszukiwaniePolaczen/StacjeFiltrRead',
                type: "POST",
                data: { wprowadzonyTekst: wprowadzonyTekst },
                cache: false,
                async: false,
            }).responseText);
            if (result.length == 1) {
                if (result[0].ID && result[0].Nazwa) {
                    var comboBox = null;
                    if (widget == self.stacjaPoczatkowaWidget()) {
                        comboBox = $(self.stacjaPoczatkowaWidget()).data("kendoComboBox");
                        comboBox.value(null);
                        comboBox.text(result[0].Nazwa);
                        comboBox.value(result[0].ID);
                        comboBox.dataSource.data([]);
                        self.idStacjiPoczatkowej(result[0].ID);
                        return true;
                    }
                    if (widget == self.stacjaKoncowaWidget()) {
                        comboBox = $(self.stacjaKoncowaWidget()).data("kendoComboBox");
                        comboBox.value(null);
                        comboBox.text(result[0].Nazwa);
                        comboBox.value(result[0].ID);
                        comboBox.dataSource.data([]);
                        self.idStacjiKoncowej(result[0].ID);
                        return true;
                    }
                    for (var s = 0; s < self.stacjePosrednie().length; s++) {                        
                        var stacja = self.stacjePosrednie()[s];
                        if (widget == stacja.stacjaWidget()) {
                            comboBox = $(self.stacjaWidget()).data("kendoComboBox");
                            comboBox.value(null);
                            comboBox.text(result[0].Nazwa);
                            comboBox.value(result[0].ID);
                            comboBox.dataSource.data([]);
                            stacja.idStacji(result[0].ID);
                            return true;
                        }
                    }
                }
            }
            return false;
        };

        self.ustawDaneInicjalizacyjne = function () {
            if (model.IdStacjiPoczatkowej > 0 && model.NazwaStacjiPoczatkowej && $.trim(model.NazwaStacjiPoczatkowej) != "") {
                var comboBoxStacjaPoczatkowa = $(self.stacjaPoczatkowaWidget()).data("kendoComboBox");
                comboBoxStacjaPoczatkowa.value(null);
                comboBoxStacjaPoczatkowa.text(model.NazwaStacjiPoczatkowej);
                comboBoxStacjaPoczatkowa.value(model.NazwaStacjiPoczatkowej);
                comboBoxStacjaPoczatkowa.dataSource.data([]);
                
            }
            if (model.IdStacjiKoncowej > 0 && model.NazwaStacjiKoncowej && $.trim(model.NazwaStacjiKoncowej) != "") {
                var comboBoxStacjaKoncowa = $(self.stacjaKoncowaWidget()).data("kendoComboBox");
                comboBoxStacjaKoncowa.value(null);
                comboBoxStacjaKoncowa.text(model.NazwaStacjiKoncowej);
                comboBoxStacjaKoncowa.value(model.NazwaStacjiKoncowej);
                comboBoxStacjaKoncowa.dataSource.data([]);
                
            }
            
            if (new Date(parseInt(model.Data.substr(6))) > new Date("1900-01-01")) {
                self.data(kendo.toString(new Date(parseInt(model.Data.substr(6))), 'yyyy-MM-dd'));
            }
            if (model.Czas.TotalMilliseconds > 0) {
                var czasHours = "" + model.Czas.Hours;
                var czasMinutes = "" + model.Czas.Minutes;
                if (model.Czas.Hours < 10)
                    czasHours = "0" + model.Czas.Hours;
                if (model.Czas.Minutes < 10)
                    czasMinutes = "0" + model.Czas.Minutes;
                self.czas(czasHours + ":" + czasMinutes);
            }
        };
    };
</script>

