    $(document).ready(function() {
        
        $('.multiMenu .item').click(function() {
            $('.multiMenu').find('.layer').slideUp(function() {
                $(this).parent('div').removeClass('active');
            });

            if ($(this).parent('div').hasClass('active')) {
                $(this).next('.layer').slideUp(function() {
                    $(this).parent('div').removeClass('active');
                });
            } else {
                $(this).next('.layer').slideDown();
                $(this).parent('div').addClass('active');
            }
        });

        
        $('.multiMenu .k-button').click(function() {
            $(this).parents().find('.layer').slideUp(function() {
                $(this).parents().find('.multiMenu').removeClass('active');
            });
        });                
    });
</script>


