<script type="text/javascript">
    $("#popup-window-mapa").kendoWindow({
        title: 'Mapa',
        close: window_close
    });
    $(window).resize(function () {
        $('.mapaPopupContent').width(window.innerWidth - 140);
        $('.mapaPopupContent').height(window.innerHeight - 100);
    });
    $('#popup-window-mapa').parent().addClass("mapaWindowContainer");
    
    var mapa_ViewModel = function () {
        var self = this;
        
        self.isOpen = ko.observable(false);
        self.windowWidget = ko.observable();
        self.isOpen.subscribe(function () {
            self.windowWidget().center();
        }, self);
    };
    var mapa_ViewObject = new mapa_ViewModel();
    ko.applyBindings(mapa_ViewObject, document.getElementById("popup-window-mapa"));
    
    function mapa_PobierzDlaStatystyk(RozkladID, ZamowienieSKRJID, DataPlanowa, StacjaPoczatkowaID, StacjaKoncowaID, Odjazdy) {
        $('.mapaPopupContent').width(window.innerWidth - 140);
        $('.mapaPopupContent').height(window.innerHeight - 100);
        mapa_ViewObject.isOpen(true);
        $('.mapaOczekiwanie').show();
        $('.mapContainer').hide();
        $.ajax({
            async: true,
            type: "POST",
            data: {
                RozkladID: RozkladID,
                ZamowienieSKRJID: ZamowienieSKRJID,
                DataPlanowa: DataPlanowa,
                StacjaPoczatkowaID: StacjaPoczatkowaID,
                StacjaKoncowaID: StacjaKoncowaID,
                Odjazdy: Odjazdy
            },
            dataType: "json",
            url: '/Trasa/PokazNaMapie',
            success: function (response) { 
                var indeksy = indeksy = JSON.stringify(new Array('0'));
                $.ajax({
                    url: '/Mapa',
                    type: "GET",
                    data: { szczegolowy: true, indeksy: indeksy, mapaRodzaj: 4 },
                    cache: false,
                    async: false,
                    success: function (result) {
                        $("#mapaWindowContent").html(result);
                        $('.mapaOczekiwanie').hide();
                        $('.mapContainer').show();
                    }
                });
            }
        });
    }
    
    function showMap(details, e) {
        $('.mapaPopupContent').width(window.innerWidth - 140);
        $('.mapaPopupContent').height(window.innerHeight - 100);
        mapa_ViewObject.isOpen(true);
        $('.mapaOczekiwanie').show();
        $('.mapContainer').hide();
        var indeksy = null;
        if (e != null) {
            indeksy = JSON.stringify(new Array(getIdentity(e).toString()));
        }
        $.ajax({
            url: '/Mapa',
            type: "GET",
            data: { szczegolowy: details, indeksy: indeksy },
            cache: false,
            async: false,
            success: function (result) {
                $("#mapaWindowContent").html(result);
                $('.mapaOczekiwanie').hide();
                $('.mapContainer').show();
            }
        });
    }
    
    function pokazPolaczeniaNaMapie() {
        showMap(true, null);
    }
    function window_close() {
        if (allPocMarkers != undefined)
            for (var i in allPocMarkers) {
                clearInterval(allPocMarkers[i].Interwal);
            }
    }
</script>

